import React, { useEffect, useState } from "react";
import { Navbar, Nav, Container } from "react-bootstrap";
import { NavLink } from "react-router-dom";
import Footer from "../../Components/Footer";
import logo from "../image/logo.png"
import "../../Pages/Home/Home.css"

const Home = () => {
  // const myuserobj = localStorage.getItem("user");
  // const user = JSON.parse(myuserobj);

  // const [userobj, setUserobj] = useState(false);

  // useEffect(() => {
  //   const loggedIn = localStorage.getItem("user");
  //   if (loggedIn) {
  //     setUserobj(true);
  //   }
  // }, []);

  // const logout = () => {
  //   localStorage.removeItem("user");
  //   setUserobj(false);
  // };
  return (
    <>
      <div className="App">
        <Navbar className="mynavbar">
          <Container>
            <Navbar.Brand href="/">
              <img
                src={logo}
                className="d-inline-block align-top logo"
                alt="psd logo"
              />
            </Navbar.Brand>

          </Container>
        </Navbar>
        <Nav className="me-auto">
          <NavLink className="nav-link" to="/">
            Home
          </NavLink>
          <NavLink className="nav-link" to="/Aboutus">
            About Us
          </NavLink>
          <NavLink className="nav-link" to="/Courses ">
            Course
          </NavLink>

        </Nav>

        <Nav>
                {!userobj ? (
                  <NavLink
                    className="nav-link"
                    to="/api/psd/employee"
                  >
                    Register As A Professional
                  </NavLink>
                ) : (
                  ""
                )}
                {!userobj ? (
                  <Nav.Link as={Link} to="/api/psd/register">
                    Register
                  </Nav.Link>
                ) : (
                  ""
                )}
                {!userobj ? (
                  <Nav.Link as={Link} to="/api/psd/user">
                    Login
                  </Nav.Link>
                ) : (
                  ""
                )}
                {userobj ? (
                  <Nav.Link as={Link} to="/" onClick={logout}>
                    Logout
                  </Nav.Link>
                ) : (
                  ""
                )}
              </Nav>
        <div>
          <div>
            <section id="home">
              <div className="container text-center">
                <div className="row justify-content-center">
                  <div className='col-md-10'>
                    <h1 className="text-white display-4">Best Online Home Service Providers In India</h1>
                    <p className="text-white"> Experienced, hand-picked Professionals to serve you at your doorstep</p>
                    <a href="/about" className="btn btn-brand">Know More</a>
                  </div></div>
              </div>
            </section>
          </div>

          <div>
            <br></br>
          </div>
        </div>
        <div className="App">

          <Footer />
        </div>

      </div>
      </>
      );
   
};

export default Home;
